import React from "react";
import axios from "axios";
import { useParams } from "react-router-dom";

const Search = () => {
  const title = useParams();
  React.useEffect(() => {
      axios.get(`/search/${title}`)
      .then((movies) => (movies))
      .catch((err) => console.error(err))
  });
  return <></>;
};

export default Search;
